var tipuesearch = {"pages":[{"title":"About","text":"2018 Fall 分組網誌 課程倉儲: https://github.com/mdecourse/2018fall 課程投影片: https://mdecourse.github.io/2018fall/reveal 課程網誌: https://mdecourse.github.io/2018fall/blog","tags":"misc","url":"./pages/about/"},{"title":"第八週 W8","text":"Onshape","tags":"Misc","url":"./2018-W8-Project-Blog.html"},{"title":"第七週 W7","text":"Onshape","tags":"Misc","url":"./2018-W7-Project-Blog.html"},{"title":"第六週 W6","text":"Onshape onshap lesson教材第三篇 1.Using Boolean operations 2.Applying linear and circular patterning 3.Applying mirror tool 4.Assemblies in Onshape 5.An introduction to concurrent top-down and bottom-up designs 6.Creating a Multi-Part design in a Part Studio","tags":"Misc","url":"./2018-W6-Project-Blog.html"},{"title":"第五週 W5","text":"Onshape 上課筆記 1.再命令提示列打 git version 可以查看p37的版本 onshap lesson教材第二篇 1.簡介\"設計意圖\" (design intent) 2.設定尺寸 (dimensions) 與約束 (constraints) 3.自動推理 (automatic inferencing) 4.繪製精確的零件 (accurate part) 5.草圖繪製練習 6.運用與建立平面 (planes) 7.建立圓角 (fillets) 與倒角 (chamfers) 8.使用多個 (multiple) 草圖區域 (sketch regions) 9.繪製時鐘模型 - 用於設計意圖教學 10.各種簡單的幾何形狀 (geometric shapes)","tags":"Misc","url":"./2018-W5-Project-Blog.html"},{"title":"第四週 W4","text":"學習onshape基本用法 學習onshape基本用法 1.說明草圖 ( sketch-based )的建模 2.介紹 4 個基本特徵 ( feature s)（擠出 ( extrude )，旋轉 ( revolve )，掃描 ( sweep )，和斷面混成 ( loaf )） 3.從 2D 過渡到 3D 4.圓柱薄殼 ( cylinder shell ) - 繪圖界面與可視化 / 檢視的介紹 5.針對既有草圖的模型 - 接續建立特徵 6.現存公用模型 (public models) - 如何搜尋並復製到工作區 ( workspace )","tags":"Misc","url":"./2018-W4-Project-Blog.html"},{"title":"第三週 W3","text":"Week3 課程內容 在test的資料夾下，在cmd輸入git init，會使其資料夾中出現.git的檔案 git log --onelingit --graph --allt e(檢視提交日誌)、git merge(合併)","tags":"Misc","url":"./2018-W3-Project-Blog.html"},{"title":"第二週 W2","text":"建立Blog Week2 1.用leo開啟pelican.leo並編輯 2.遠端牽涉到連結,故至pelican設定/遠端/@edit publishconf.py修改SITEURL='https://mdecadp2018.github.io/site-40423144/blog' 3.在pelican設定/@edit publishconf.py/修改課程名稱\"mdecadp2018\" python wsgi.py 可得到自己的近端網址，並打開伺服器，不輸入會連不上localhost:8443。 靜態網頁資料 Y:/tmp/site/content 圖片資料 Y:/tmp/site/images 文件資料 Y:/tmp/site/downloads 課程倉儲 利用 Github 倉儲存放與計算機程式相關的資料, 有幾項好處: 第一, 在不自建網站的情況下, 目前 Github 仍允許免費使用, 管理者除了可以利用網際模式將資料送到對應的 cp github 倉儲 外, 也可以利用近端的 git 客戶端程式, 以分散式版次的流程管理各階段的改版資料. 第二, Github 提供的 Github Pages, 可以讓純 html 加上 Javascript 的網站, 直接在 cp 課程網站 伺服. 第三, 改版後的 CMSimfly, 加上 Pelican 靜態網誌與 Reveal.js 投影片系統, 均為靜態網站資料, 可以直接整合一起, 透過一個網址當作上課參考資料. 該學習哪種程式語言? C/C++、Python、Lua 或 Javascript? 都可以. 在這裡, 學 C/C++ 是為了編寫 Arduino 控制程式, 以及結合 Qt5 建立各種能快速進行工程分析的程式庫, 學習 Python 是為了快速完成 C/C++ 無法迅速完成的分析、模擬與運算, 也能透過 PyQt5 建立視窗程式, 或者呼叫 Flask 建立能在網際環境中執行的協同設計套件. 學習 Lua 是為了能在 V-rep 中使用, 至於 Javascript, 已經無所不在, 尤其在網際成是開發過程, 更是重要, 有其學習的必要性.","tags":"Misc","url":"./2018-W2-Project-Blog.html"},{"title":"第一週 W1","text":"Week 1:領取個人期中作業 課程內容 記得攜帶筆記本、耳機、USB隨身碟及建立Onshape帳號。 說明如何利用 p37 中的 git 建立個人的 Github Pages 網站。 利用 https://classroom.github.com/a/fGqXU9kO 領取個人期中作業網誌。 上課影片 作業內容 翻譯 1.完成有預製草圖的CAD模型 a.打開文件 : College - Pre-made Sketches document b.製作 一個你自己的私人複製版本 c.注意工作頁面螢幕下方的標籤，每個部分有\"完成前\"\"完成後\"的標籤。使用預製草圖在\"完成前\"標籤，製作一個幾何和\"完成後\"所表示的文件一樣。不用擔心高度要完全一致，只要接近和看起來一樣。 2.做以下型號，只要透過觀察以下的3D模型。只要長得很像，尺寸並不重要，只要嘗試讓型態相近。這個練習重點在於你想的和你\"看\"的草圖和幾何特徵。每個部件有很多方式。 Onshape Homework影片","tags":"Misc","url":"./2018-W1-Project-Blog.html"},{"title":"2018 Fall 分組網誌","text":"2018 Fall 開始將網際內容管理、投影片與網誌進行整合. 課程倉儲 利用 Github 倉儲存放與計算機程式相關的資料, 有幾項好處: 第一, 在不自建網站的情況下, 目前 Github 仍允許免費使用, 管理者除了可以利用網際模式將資料送到對應的 cp github 倉儲 外, 也可以利用近端的 git 客戶端程式, 以分散式版次的流程管理各階段的改版資料. 第二, Github 提供的 Github Pages, 可以讓純 html 加上 Javascript 的網站, 直接在 cp 課程網站 伺服. 第三, 改版後的 CMSimfly, 加上 Pelican 靜態網誌與 Reveal.js 投影片系統, 均為靜態網站資料, 可以直接整合一起, 透過一個網址當作上課參考資料. 該學習哪種程式語言? C/C++、Python、Lua 或 Javascript? 都可以. 在這裡, 學 C/C++ 是為了編寫 Arduino 控制程式, 以及結合 Qt5 建立各種能快速進行工程分析的程式庫, 學習 Python 是為了快速完成 C/C++ 無法迅速完成的分析、模擬與運算, 也能透過 PyQt5 建立視窗程式, 或者呼叫 Flask 建立能在網際環境中執行的協同設計套件. 學習 Lua 是為了能在 V-rep 中使用, 至於 Javascript, 已經無所不在, 尤其在網際成是開發過程, 更是重要, 有其學習的必要性.","tags":"Misc","url":"./2018-Fall-Project-Blog START.html"}]};